If the specified key is not already associated with a value, associates it with the given value. This is equivalent to, for this map:  
 if (!map.containsKey(key))
   return map.put(key, value);
 else
   return map.get(key); except that the action is performed atomically.

Removes the entry for a key only if currently mapped to a given value. This is equivalent to, for this map:  
 if (map.containsKey(key)
     && Objects.equals(map.get(key), value)) {
   map.remove(key);
   return true;
 } else {
   return false;
 } except that the action is performed atomically.

Replaces the entry for a key only if currently mapped to a given value. This is equivalent to, for this map:  
 if (map.containsKey(key)
     && Objects.equals(map.get(key), oldValue)) {
   map.put(key, newValue);
   return true;
 } else {
   return false;
 } except that the action is performed atomically.

Replaces the entry for a key only if currently mapped to some value. This is equivalent to, for this map:  
 if (map.containsKey(key))
   return map.put(key, value);
 else
   return null; except that the action is performed atomically.

If the specified key is not already associated with a value (or is mapped to null), attempts to compute its value using the given mapping function and enters it into this map unless null. If the mapping function returns null, no mapping is recorded. If the mapping function itself throws an (unchecked) exception, the exception is rethrown, and no mapping is recorded. The most common usage is to construct a new object serving as an initial mapped value or memoized result, as in:  
 map.computeIfAbsent(key, k -> new Value(f(k)));
 Or to implement a multi-value map, Map<K,Collection<V>>, supporting multiple values per key:  
 map.computeIfAbsent(key, k -> new HashSet<V>()).add(v);
 The mapping function should not modify this map during computation.

